import Dot from "./dot";
import HorizontalLine from "./horizontal_line";

const RowWithDots = ({indices, handleClick}) => {
    return (
        <tr>
            <td><Dot /></td>
            <td><HorizontalLine/></td>
            <td><Dot /></td>
            <td><HorizontalLine/></td>
            <td><Dot /></td>
            <td><HorizontalLine/></td>
            <td><Dot /></td>
        </tr>
    )
}

export default RowWithDots;
